The Court withholds sentence and places the defendant on probation for a period of three (3) years.
Conditions of probation:
1) Pay court costs;
2) pay supervision fees in an amount to be determined by DOC;
3) Submit to random urine screens and pay for same;
4) Maintain absolute sobriety from alcohol and drugs unless legally prescribed and taken in prescribed doses;
5) Spend twelve (12) months in the county jail, under the Huber Law, commencing on 02-03-15 by 8:30 a.m.  The Court will allow release for dental appointments and procedures;
6) Maintain fulltime employment, schooling or community service of twenty (20) hours per week if not fully employed;
7) Assessment, treatment, counseling as deemed appropriate by the Departments assessment process, including psychiatric evaluation and treatment.
